<script>
    // selektor będzie pasował do wszystkich kontrolek wejściowych typu: checkbox
    // i dołącz moduł obsługi zdarzenia kliknięcia
    $(""input:checkbox"").on('click', function () {
        // in the handler, 'this' refers to the box clicked on
        var $box = $(this);
        if ($box.is("":checked"")) {
            // nazwa skrzynki jest pobierana za pomocą metody .attr ()
            // tak jak zakłada się i oczekuje się, że będzie niezmienny
            var group = ""input:checkbox[name='"" + $box.attr(""name"") + ""']"";
            // z drugiej strony zmieni się stan zaznaczenia grupy / pola
            // a bieżąca wartość jest pobierana przy użyciu metody .prop ()
            $(group).prop(""checked"", false);
            $box.prop(""checked"", true);
        } else {
            $box.prop(""checked"", false);
        }
    });
</script>");
